import styled from "styled-components";

export const WrapperVariables = styled('button')`
& {
    cursor: pointer;
    width: 150px;
    height: 70px;
    background-color: green;
    border: 1px solid #e6e6e6;
    color: white;
    border-radius: 5px;
    opacity: .5;
} 
`
